   High-Level Steps:
   1. Login and navigate to Accounts Payable --> Edit, Audit & Post
   2. Run all the Audit reports with default filter selections.
   Expected: System able to Run all the Audit reports with default filter selections. */
cy.visit('SimplyFastPA2/InvoiceTransactions.aspx?');
cy.get('[value="Audit Reports"]').contains('Audit Reports').click();
cy.get('iframe').should('exist').should('be.visible');
const iframeSelector = 'iframe';
const accSelector = 'input[value="By Account"]';
const transactionSelector = 'input[value="By Transaction"]';
