cy.getIframeBody(iframeSelector).find(transactionSelector).should('be.visible').invoke('removeAttr', 'formtarget').click();
cy.get('[class="os-internal-ui-dialog-titlebar-close os-internal-ui-corner-all"]').click();
cy.get('[value="Audit Reports"]').contains('Audit Reports').click();
cy.get('iframe').should('exist').should('be.visible');
cy.getIframeBody(iframeSelector).find(vendorSelector).should('be.visible').invoke('removeAttr', 'formtarget').click();

/*
     Module:LUCA(AP Edit)
    Last updated:Chandini(03/01/2025)
    TC13001
    Edit Invoice page displays the selected transaction.
    Audit Reports, Delete, Cancel, Exit and Save buttons exist.
    For Posted Open transactions:  Void AP, Cancel, Exit, and Save buttons display.
     For Posted Paid transactions, only the Exit buton displays.
     */
Cypress.on('uncaught:exception', (err, runnable) => {
    if (err.message.includes('Cannot read properties of null')) {
        return false; // Prevent the error from failing the test
    }
    return true; // Allow the test to fail for other errors
});
cy.visit('/SimplyFastPA2/home.aspx');
CreateNotpostedEntry();
cy.wait(5000);
cy.get('[value="Exit"]').click();
cy.get('table tr').eq(1).find('a').eq(0).click();
cy.get('[value="Audit Reports"]').should('be.visible');
cy.get('[value="Delete"]').should('be.visible');
cy.get('[class="btn-target"]').should('be.visible');
cy.get('.btn-saveValidate').should('be.visible');
cy.get('[value="Exit"]').should('be.visible');
cy.get('.btn-saveValidate').click();
//For Posted Open transactions:  Void AP, Cancel, Exit, and Save buttons display.
Post();
cy.get('select.ThemeGrid_Width2').select('POSTED OPEN');
cy.wait(3000);
cy.get('table').should('be.visible').find('tr').eq(1).find('a').eq(0).click();
cy.get('[value="Void AP"]').should('be.visible');
cy.get('[class="btn-target"]').contains('Cancel').should('be.visible');
cy.get('[class="btn-saveValidate"]').should('be.visible');
cy.get('[value="Exit"]').should('be.visible').click();
cy.wait(3000); //wait until exit the transaction
// For Posted Paid transactions, only the Exit buton displays.
cy.get('select.ThemeGrid_Width2').select('POSTED PAID');
cy.get('table tr').eq(1).find('a').eq(0).click();
cy.get('[value="Exit"]').should('be.visible');

