const expectedHeaders = [
    'ATTCH',
    'COMPANY / LAST NAME',
    'CHECK NAME',
    'OPTIONAL 2ND LINE',
    'ADDRESS1',
    'ADDRESS 2',
    'CITY',
    'STATE',
