    .each(($header, index) => {
    const normalizeText = (text) => text.replace(/\s*\/\s*/g, '/');
    cy.wrap($header)
        .find('span')
        .invoke('text')
        .then((headerText) => {
        const actualText = normalizeText(headerText.trim().toUpperCase());
