// Performance tracking
const reportPerformance = {};
// Wait for iframe to load and then interact with elements inside the iframe
cy.getIframeBody('iframe[src*="FilterScreenLedgerList.aspx"]', { timeout: 10000 }).then(($iframeBody) => {
    cy.log('Iframe body loaded:', $iframeBody);
    const measureReport = (reportName, selector) => {
        const startTime = Date.now();
        cy.wrap($iframeBody).find(`input[name="${selector}"]`).should('be.visible').click({ force: true });
        // Wait for some indication the report generation is complete
        //cy.wait(2000);
        const endTime = Date.now();
        const duration = endTime - startTime;
        reportPerformance[reportName] = duration;
        cy.log(`${reportName} report took ${duration} ms to generate.`);
    };
    // Generate reports and measure performance
    measureReport('Transaction', 'WebPatterns_wtLedgerListPopup$block$wtMainContent$wtByTransaction');
