    measureReport('Debit-Credit', 'WebPatterns_wtLedgerListPopup$block$wtMainContent$wtByAccount7');
    // Log performance metrics
    cy.log('Performance Metrics:', reportPerformance);
    // Optionally, write metrics to a file (requires custom Cypress setup for writing files)
    cy.writeFile('cypress/results/performance-metrics.json', reportPerformance);
});

