cy.visit('SimplyFastPA2/CardTransactions.aspx');
function getColumnValues(tableSelector, columnIndex) {
    return cy.get(`${tableSelector} tbody tr`).then((rows) => {
        const values = [];
        Cypress._.each(rows, (row) => {
            const text = Cypress.$(row).find('td').eq(columnIndex).text().trim();
            values.push(text);
        });
        return values;
    });
}
function checkSorted(values, type = 'text', order = 'asc') {
    const cleanedValues = values.map((val) => {
        if (type === 'number') {
            return Number(val.replace(/,/g, '')); // Clean and convert
        }
        return val.toLowerCase(); // Case-insensitive for text
    });
    const sorted = [...cleanedValues].sort((a, b) => {
        if (type === 'number')
            return a - b;
        return a.localeCompare(b);
    });
    if (order === 'desc')
        sorted.reverse();
    expect(cleanedValues, `Expect column to be sorted in ${order} order`).to.deep.equal(sorted);
}
const tableSelector = 'table#DublinTheme_wt71_block_wtMainContent_wtCDTable';
// Check numeric column (e.g. 4th column - index 3)
