const numberColumnHeader = `${tableSelector} thead tr th:nth-child(${numberColumnIndex + 1})`;
// Descending
cy.get(numberColumnHeader).click();
cy.wait(1000);
getColumnValues(tableSelector, numberColumnIndex).then((values) => {
    checkSorted(values, 'number', 'desc');
});
// Ascending
cy.get(numberColumnHeader).click();
cy.wait(1000);
getColumnValues(tableSelector, numberColumnIndex).then((values) => {
    checkSorted(values, 'number', 'asc');
});
