    checkSorted(values, 'text', 'desc');
});
// Ascending
cy.get(textColumnHeader).click();
cy.wait(1000);
getColumnValues(tableSelector, textColumnIndex).then((values) => {
    checkSorted(values, 'text', 'asc');
});

