/*
Module: LUCA - Account Payable
Last Updated : Aiman(18/2/2025)
High Level Test Steps:
Insert Data in Invoice Entry
Expected: Successfully saved.
*/
cy.visit('/SimplyFastPA2/InvoiceEntry.aspx');
function selectVendorWithPO(index = 0) {
    cy.get('[class="select2-selection__rendered"]').click();
    cy.get('.select2-results__option').then(($vendors) => {
        if (index >= $vendors.length) {
            throw new Error('No vendor with available PO dropdown found.');
        }
        const vendor = $vendors[index];
        cy.wrap(vendor).click();
        cy.wait(1000); // Wait for the PO field to render
        // Check if the PO field is an input (no PO) or a dropdown (PO exists)
        cy.get('body').then(($body) => {
            if ($body.find('input[name*="wtLedgerTransaction_PONumber"]').length > 0) {
                // It's an input — means no PO — try next vendor
                selectVendorWithPO(index + 1);
            }
            else {
                // PO dropdown is available
                cy.get(':nth-child(2) > .select2 > .selection > .select2-selection > .select2-selection__rendered').click();
                cy.get('.select2-results__option').then(($poOptions) => {
                    const validPOs = $poOptions.filter((i, el) => !el.innerText.includes('-'));
                    if (validPOs.length > 0) {
                        cy.wrap(validPOs[0]).click();
                        proceedWithInvoiceEntry();
                    }
                    else {
                        // No valid PO in dropdown — try next vendor
                        selectVendorWithPO(index + 1);
                    }
                });
            }
        });
    });
}
function proceedWithInvoiceEntry() {
    cy.wait(2000);
    // Interact inside iframe
    cy.get('iframe')
        .its('0.contentDocument.body')
        .should('not.be.empty')
        .then(cy.wrap)
        .find('#RichWidgets_wt21_block_wtMainContent_WebPatterns_wtViewLedgerDetail2_block_wtPanelContent_wtPOReliefTransactionTable_ctl03_wtSelectCheckBox')
        .should('be.visible')
        .check();
    cy.get('iframe')
        .its('0.contentDocument.body')
        .should('not.be.empty')
        .then(cy.wrap)
        .find('#RichWidgets_wt21_block_wtMainContent_WebPatterns_wtViewLedgerDetail2_block_wtActions_wt14')
        .should('be.visible')
        .click();
    const randomString = Math.random().toString(36).substring(2, 7).toUpperCase();
    // Invoice Number
    cy.get('input[name*="wtLedgerTransaction_DocumentNumber"]').type(randomString);
    // Invoice Amount
    cy.get('input[name*="wtLedgerTransaction_DocumentAmount_ciw"]')
        .then(($input) => $input.removeAttr('readonly'))
        .clear()
        .type('1000', { delay: 100 });
    // Description
    cy.get('input[name*="wtLedgerTransaction_DocumentDescription"]').clear().type('TESTING', { delay: 100 });
    // Amount
    cy.get(':nth-child(2) > .wj-align-right').should('be.visible').click().type('1000', { delay: 100 });
    // Save
    cy.contains('a', 'Save').click();
    cy.get('.Feedback_Message_Text', { timeout: 30000 }).should('be.visible');
}
